window.bookSummaryJSON = "<p><b>Go big or go home.</b> For privateer Captain Magdalene Landon, it's all about going big. For Kay Ellis, it's about getting home. Together, they're about to architect the most daring heist in the galaxy.&nbsp;</p> <p>Kay knows too much. She knows it’s a matter of time before a conglomerate hitman finds her. She’s desperate for safe passage back to Union space.</p> <p>Then Magdalene shows up, promising a way home in exchange for that information. It’s a risky bet, but Kay is out of options. So she strikes a deal: the heist of the century for her freedom.</p> <p>Kay is playing a dangerous game, and she knows it. She’s made herself enemy number one of the conglomerate. She’s relying on privateers for her safety. It’s a fool’s game. But the worst part is, her fool’s heart is starting to warm to the enigmatic captain. And that’s a risk for which she hadn’t planned.</p>"; 
